def can_make_word(input_word, dict_word):
    # If every character of dict_word appears in input_word in the right order then we can do this.
    # O(dict_word + input_word) would be a good start.
    if len(input_word) < len(dict_word):
        return False
    j = 0
    for i in range(len(dict_word)): # O(dict_word)
        while True: # j only increment O(input_word) times.
            if dict_word[i] == input_word[j]:
                j += 1 # Took this element.
                break
            j += 1
            if j >= len(input_word):
                return False
            # Slight optimization
            # chars left < chars need to make: can't do.
            if len(input_word) - j < len(dict_word) - i:
                return False
    return True


# Want the longest possible string, if more than 1 result return smallest lexicographical order.
# Can sort dict (given as array) by length.
# Once we have a match for things of the max length possible we break and then sort that array.
class Solution(object):
    def findLongestWord(self, s, d):
        """
        :type s: str
        :type d: List[str]
        :rtype: str
        """
        if not d:
            return ""
        d.sort(key=len, reverse=True)

        max_len_found = None
        output = []
        for d_word in d:
            if can_make_word(s, d_word):
                if not max_len_found:
                    max_len_found = len(d_word)
                    output.append(d_word)
                else:
                    if len(d_word) < max_len_found:
                        break
                    else:
                        output.append(d_word)

        output.sort()
        if output:
            return output[0]
        return ""

